Text Section:
			καὶ ἐβόησαν
φωνῇ εἰς τὸν οὐρανὸν λέγοντες Τί ποιήσαρμεν τούτοις, καὶ ποῦ
αὐτοὺς ἀπαγάγωμεν ;

			10 EXC.: Orib. XII s. v. (τραγάκανθα — ὑπόγλυκυς);
                                Orib. V 78 (unde Aet. II 196); cf. de virt. med. Gal. XII 143 (unde
                                Aet. I s. v. Paul. Aeg. VII 3 s. v.).

Translated Text:
5 And it shall be like as if one gather a standing harvest, and
reap the seed of ears of corn with his arm; and it shall be like as
if one gather an ear of corn in a barren valley,

Text Section:
			2 Τίνα πρῶτον ἐθέλεις παραγάγωμεν;
 Τουτονὶ τὸν κομήτην, τὸν Ἰωνικόν, ἐπεὶ καὶ
 σεμνός τις εἶναι φαίνεται.
